import homeCard from './OOS';
import { motion } from 'framer-motion';

let card={width: 100, height:100, backgroundColor:"#ffffff", margin:10, borderRadius:12, textAlign:'center',  shadowColor: "#000",
shadowColor: "#000",
shadowOffset: {
width: 0,
height: 9,
},
shadowOpacity: 0.48,
shadowRadius: 11.95,

elevation: 18}

function App() {


 return (
    <div>
  <homeCard />
  <motion.h1 
  animate={{fontSize: 60, color: "#33333", x: 100, y: 10 ,
}}
  transition={{ type:"spring", velocity: 120 }}  
   >
  OOS
  </motion.h1>



   <div>
   <div style={card} ><p style={{paddingTop:40}}>列表</p></div>
   <div style={card} ><p style={{paddingTop:40}}>弹窗 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>界面跳转 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>选择类</p> </div>
   <div style={card} ><p style={{paddingTop:40}}>其他类 </p></div>
   </div>
   <div style={{marginLeft: 120, marginTop:-580}}>
   <div style={card} ><p style={{paddingTop:40}}>点击反馈</p> </div>
   <div style={card} ><p style={{paddingTop:40}}>提升类 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>删除类 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>展开折叠类</p> </div>
   </div>


   </div>
  )
}

export default App;
